const Experiences = () => [
  {
    expertise: 'Jr. Front-end Developer',
  },
  {
    expertise: 'Good knowledge about WordPress',
  },
  {
    expertise: 'Basic knowledge about Figma , photoshop and illustrator.',
  },
  {
    expertise: 'Familiar with VS Code, Notepad++ and Dreamweaver.',
  },
  {
    expertise:
      'Know about third party integration using third party tools like zapier',
  },
  {
    expertise: 'Know about hosting (C-Panel)',
  },
  {
    expertise:
      'Developing responsive web application across platforms and mobile using html, css, javascript',
  },
];
export default Experiences;
